import React, { Suspense, useState, useEffect } from "react";
import { Canvas } from "@react-three/fiber";
import { Sphere, Float } from "@react-three/drei";
import { motion } from "framer-motion";
import * as THREE from "three";

const IMAGE_DATA = [
  { path: "/assets/sugam_lab.jpg", name: "Sugam in Lab", desc: "Working on microbiology research" },
  { path: "/assets/placeholder1.jpg", name: "Project Work", desc: "Data analysis & insights" },
  { path: "/assets/placeholder2.jpg", name: "Innovations", desc: "Strategic implementations" },
  { path: "/assets/placeholder3.jpg", name: "Team Moments", desc: "Collaboration & growth" },
  { path: "/assets/placeholder4.jpg", name: "Success Stories", desc: "Achievements & milestones" },
];

const COLORS = ["#00d9ff", "#ff6b9d", "#ffd700", "#00ff88", "#9d4edd"];

function GalleryImageOrb({ position, index, imagePath }) {
  const [texture, setTexture] = useState(null);

  useEffect(() => {
    const loader = new THREE.TextureLoader();
    loader.load(
      imagePath,
      (tex) => setTexture(tex),
      undefined,
      () => setTexture(null)
    );
  }, [imagePath]);

  return (
    <Float floatIntensity={0.4} speed={1.2}>
      <Sphere position={position} args={[0.6, 28, 28]}>
        {texture ? (
          <meshStandardMaterial map={texture} />
        ) : (
          <meshStandardMaterial 
            color={COLORS[index % COLORS.length]} 
            emissive={COLORS[index % COLORS.length]}
            emissiveIntensity={0.45}
          />
        )}
      </Sphere>
    </Float>
  );
}

function Gallery3DContent() {
  const positions = [
    [0, 0, 0],
    [-1.6, 1.1, -1.4],
    [1.6, 1.1, -1.4],
    [-1.2, -1.3, -1.8],
    [1.2, -1.3, -1.8],
  ];

  return (
    <>
      {IMAGE_DATA.map((data, i) => (
        <GalleryImageOrb key={i} position={positions[i]} index={i} imagePath={data.path} />
      ))}
    </>
  );
}

export default function GallerySection() {
  const [hoveredIndex, setHoveredIndex] = useState(null);

  return (
    <section className="gallery-section">
      <motion.h2
        initial={{ opacity: 0 }}
        whileInView={{ opacity: 1 }}
        transition={{ duration: 0.6 }}
      >
        Gallery & Moments
      </motion.h2>

      <div className="gallery-canvas">
        <Canvas camera={{ position: [0, 0, 5.5], fov: 45 }}>
          <color attach="background" args={["#0a0e1a"]} />
          <ambientLight intensity={0.65} />
          <pointLight position={[5, 5, 5]} intensity={0.9} color="#00d9ff" />
          <pointLight position={[-5, -5, 5]} intensity={0.7} color="#ff6b9d" />
          <Suspense fallback={null}>
            <Gallery3DContent />
          </Suspense>
        </Canvas>
      </div>

      <div className="gallery-info">
        <div className="gallery-image-list">
          {IMAGE_DATA.map((data, i) => (
            <motion.div
              key={i}
              className="gallery-image-item"
              onMouseEnter={() => setHoveredIndex(i)}
              onMouseLeave={() => setHoveredIndex(null)}
              whileHover={{ scale: 1.05 }}
            >
              <div className="gallery-dot" style={{ backgroundColor: COLORS[i] }}></div>
              <div className="gallery-tooltip">
                <div className="gallery-tooltip-name">{data.name}</div>
                <div className="gallery-tooltip-desc">{data.desc}</div>
              </div>
            </motion.div>
          ))}
        </div>
      </div>
    </section>
  );
}
